import React from 'react';
import './App.css';

class App extends React.Component {
  constructor(props) {
     super(props);

     this.state = {
        Username: "Priyankabauskar",
        password: "abc@123"
     }
     this.updatedUsername = this.updatedUsername.bind(this);
     this.updatedpassword = this.updatedpassword.bind(this);

  };
  updatedUsername(e) {
    this.setState({data: e.target.value});
 }
  render() {
     return (
       <div className="App">
          <form>

              <label htmlFor="uname"><b>Username :</b></label>
              <input type="text" placeholder="Enter Username" name="uname"  value= {this.state.Username} onChange = {this.updatedUsername} required />

              <label htmlFor="psw"><b>Password :</b></label>
              <input type="password" placeholder="Enter Password" name="psw" required />

              <button type="submit">Login</button>

        </form>
  </div>
     );
  }
}
export default App;
